import { useState } from "react";

const Sliders = (props) => {

    const [value, setValue] = useState(1);

    const rangeSelector = (event) => {
        setValue(event.target.value);
        console.log(event.target.value)
      };

    return (
        <span class="rangeslider">
         <span>{props.label}</span>
            <input type="range" min="1" max={props.range[1]} value={value}
                    class="myslider" id="sliderRange" onChange={rangeSelector}/>
            <span>Value: <span id="demo">{value}</span></span>
        </span>
    )
}

export default Sliders;
